prompt:
You are an expert in JSON webpage creation. Your task is to generate a JSON structure for a webpage based on the following requirements: {input}. Ensure that the JSON includes the following elements:

1. Each section object must have a 'type' field from a fixed vocabulary (e.g., 'header', 'footer', 'section', 'form', 'image', 'text', 'button', 'link', 'list', 'table', 'grid', 'card', 'embed').

2. Include an 'updatedAt' field with an ISO-8601 timestamp to indicate when the JSON was last updated.

3. For all image objects, use 'src' for the image URL and include an 'alt' attribute for accessibility unless the image is purely decorative.

4. Ensure that all internal links start with '/' and external links start with 'https'.

5. Avoid using comments within the JSON structure, as JSON does not support comments.

6. Ensure numeric values are not quoted unless they are part of a string.

7. Validate email fields against the regex pattern: [A-Za-z0-9._%+-]+@[A-Za-z0-9.-]+\.[A-Za-z]{2,} to ensure they include a top-level domain.

8. If applicable, include a 'warnings' array to flag any external links that do not use HTTPS.

By following these guidelines, you will create a JSON webpage that adheres to the specified rule set and is both correct and accessible.

Example:

Input: Design a webpage for a charity organization looking to raise funds for a clean water project, with donation tiers, testimonials, and a mission statement.

Output:
{
  "updatedAt": "2024-06-15T14:30:00Z",
  "type": "page",
  "title": "Clean Water Charity",
  "sections": [
    {
      "type": "header",
      "logo": {
        "type": "image",
        "src": "/assets/logo.png",
        "alt": "Clean Water Charity Logo"
      },
      "navigation": [
        {
          "type": "link",
          "label": "Home",
          "href": "/"
        },
        {
          "type": "link",
          "label": "Our Mission",
          "href": "/mission"
        },
        {
          "type": "link",
          "label": "Donate",
          "href": "/donate"
        },
        {
          "type": "link",
          "label": "Testimonials",
          "href": "/testimonials"
        },
        {
          "type": "link",
          "label": "Contact",
          "href": "/contact"
        }
      ]
    },
    {
      "type": "section",
      "id": "mission",
      "content": [
        {
          "type": "text",
          "heading": "Our Mission",
          "body": "We are dedicated to ensuring every person has access to clean, safe drinking water. Through sustainable projects and community partnerships, we empower people to lead healthier, more productive lives."
        }
      ]
    },
    {
      "type": "section",
      "id": "donation-tiers",
      "content": [
        {
          "type": "text",
          "heading": "Donation Tiers",
          "body": "Choose a donation level and see the impact your gift can make."
        },
        {
          "type": "grid",
          "columns": 3,
          "items": [
            {
              "type": "card",
              "title": "Supporter",
              "amount": 25,
              "description": "Provides clean water for one child for a year.",
              "button": {
                "type": "button",
                "label": "Donate $25",
                "href": "/donate?amount=25"
              }
            },
            {
              "type": "card",
              "title": "Advocate",
              "amount": 100,
              "description": "Supplies a family with a water filter.",
              "button": {
                "type": "button",
                "label": "Donate $100",
                "href": "/donate?amount=100"
              }
            },
            {
              "type": "card",
              "title": "Champion",
              "amount": 500,
              "description": "Helps build a community well.",
              "button": {
                "type": "button",
                "label": "Donate $500",
                "href": "/donate?amount=500"
              }
            }
          ]
        }
      ]
    },
    {
      "type": "section",
      "id": "testimonials",
      "content": [
        {
          "type": "text",
          "heading": "What Our Supporters Say"
        },
        {
          "type": "list",
          "items": [
            {
              "type": "card",
              "image": {
                "type": "image",
                "src": "/assets/testimonial1.jpg",
                "alt": "Portrait of donor Sarah"
              },
              "quote": "Donating to this project was the best decision I made this year. Seeing the impact firsthand was incredible.",
              "author": "Sarah M."
            },
            {
              "type": "card",
              "image": {
                "type": "image",
                "src": "/assets/testimonial2.jpg",
                "alt": "Portrait of beneficiary Ayo"
              },
              "quote": "Now my children can go to school instead of spending hours fetching water. Thank you!",
              "author": "Ayo, Community Member"
            }
          ]
        }
      ]
    },
    {
      "type": "footer",
      "content": [
        {
          "type": "text",
          "body": "© 2024 Clean Water Charity. All rights reserved."
        },
        {
          "type": "list",
          "items": [
            {
              "type": "link",
              "label": "Privacy Policy",
              "href": "/privacy"
            },
            {
              "type": "link",
              "label": "Terms of Service",
              "href": "/terms"
            },
            {
              "type": "link",
              "label": "Contact Us",
              "href": "/contact"
            }
          ]
        }
      ]
    }
  ],
  "warnings": [
    {
      "type": "externalLink",
      "message": "External link to payment processor used in donation form.",
      "url": "https://secure.donatewater.org"
    }
  ]
}

By following these guidelines and examples, you will create a JSON webpage that adheres to the specified rule set and is both correct and accessible.

